// import logo from "./logo.svg";
// import "./App.css";
import Home from "./Pages/Home";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="classes" element={<Classes />} />
        <Route path="questionsets" element={<QuestionSet />} />
      </Routes>
    </div>
  );
}

export default App;
